        <Container>
        <Navbar.Brand>Employee Assignment</Navbar.Brand>
                <Nav className="navbar-nav mx-auto">
                    <Nav.Link href='/'id="navItem">Home</Nav.Link>
                    <Nav.Link href='/addEmployee' id="navItem">Add</Nav.Link>
                    <Nav.Link href='/employees' id="navItem">List</Nav.Link>
                </Nav>
        </Container>
        </Navbar>
    )
}

export default NavigationBar;
